    listenScrollEvent = e => {
        if (window.scrollY > 400) {
            this.setState({color: 'black'})
        } else {
            this.setState({color: 'white'})
        }
    }



    render(){
        return(
            <div className="navbar navbar-custom sticky navbar-fixed-top" role="navigation" id="sticky-nav">
                <div className="container">

                    <div className="navbar-header">

                        <button type="button" className="navbar-toggle" data-toggle="collapse"
                                data-target=".navbar-collapse">
                            <span className="sr-only">Toggle navigation</span>
                            <span className="icon-bar"></span>
                            <span className="icon-bar"></span>
                            <span className="icon-bar"></span>
                        </button>
                        <a className="navbar-brand logo" href="index.html">
                            UB<span className="text-custom">o</span>ld
                        </a>

                    </div>

                    <div className="navbar-collapse collapse" id="navbar-menu">
                        <ul className="nav navbar-nav navbar-right">
                            <li className="active">
                                <a href="#home" className="nav-link">Home</a>
                            </li>
                            <li>
                                <a href="#features" className="nav-link">Features</a>
                            </li>
                            <li>
                                <a href="#pricing" className="nav-link">Plans</a>
                            </li>
                            <li>
                                <a href="#clients" className="nav-link">Clients</a>
                            </li>
                            <li>
                                <a href="">Login</a>
                            </li>
                            <li>
                                <a href="" className="btn btn-white-bordered navbar-btn">Try for Free</a>
                            </li>
                        </ul>

                    </div>
                </div>
            </div>
        );
    }
}

export default Navbar;
